Candidate_Votes calculate_results(std::vector<int> stationVotes) {
    int maxVote = stationVotes[0];
    int pos = 0;
    for (int i = 0; i< stationVotes.size(); i++) {
        if (maxVote < stationVotes[i]) {
            maxVote = stationVotes[i];
            pos = i;
        }
    }
    
    Candidate_Votes CV;
    CV.candidateNumber = pos + 1;
    CV.vote = maxVote;
    
    return CV;
}

Candidate_Votes calculate_min_votes(std::vector<int> stationVotes) {
    int minVote = stationVotes[0];
    int pos = 0;
    for (int i = 0; i< stationVotes.size(); i++) {
        if (minVote > stationVotes[i]) {
            minVote = stationVotes[i];
            pos = i;
        }
    }
    Candidate_Votes CV;
    CV.candidateNumber = pos + 1;
    CV.vote = minVote;
    
    return CV;
}

