#include <IRremote.h>
#include <ir_Lego_PF_BitStreamEncoder.h>
#include <Servo.h>
#include <LCD-I2C.h>

#define linker_motor 7
#define rechter_motor 6
#define linker_motor_kloktegen 4
#define rechter_motor_kloktegen 5

int IR_RECEIVE_PIN = 2;
IRrecv IrReceiver(IR_RECEIVE_PIN);
decode_results results;


void setup() {
  Serial.begin(9600);
  Serial.println("je moeder");
  motorsetup();
  irsetup();
}

void loop() {
  controller();
}


void irsetup(){
  Serial.println("start IR ontvanger");
  IrReceiver.enableIRIn();  // Start ontvanger
  pinMode(LED_BUILTIN, OUTPUT); 
  IrReceiver.blink13(true);
}

void controller(){
      if (IrReceiver.decode(&results)){
      Serial.println(results.value, HEX);
      switch(results.value)
      {
        case 0xFF18E7: //pijl naar voor
        naarvoor();
        break;
        
        case 0xFF10EF: //pijl naar links
        linksaf();
        break;
        
        case 0xFF5AA5: //pijl naar rechts
        rechtsaf();
        break;

        case 0xFF4AB5: //pijl naar achter
        naarachter();
        break;

        default:
        motor_stop();
        
  }
  delay(200);
  IrReceiver.resume();//loop until told differently
  }
}


void motorsetup(){
  pinMode(linker_motor, OUTPUT);
  pinMode(rechter_motor, OUTPUT);
  pinMode(linker_motor_kloktegen, OUTPUT);
  pinMode(rechter_motor_kloktegen, OUTPUT);
}


void linksaf(){
  digitalWrite(linker_motor_kloktegen, HIGH);
  digitalWrite(rechter_motor, HIGH);
  digitalWrite(linker_motor, HIGH);
}

void rechtsaf(){
  digitalWrite(rechter_motor_kloktegen, HIGH);
  digitalWrite(rechter_motor, HIGH);
  digitalWrite(linker_motor, HIGH);
}

void naarachter(){
  digitalWrite(linker_motor, HIGH);
  digitalWrite(rechter_motor, HIGH);
}

void naarvoor(){
  digitalWrite(linker_motor_kloktegen, HIGH);
  digitalWrite(rechter_motor_kloktegen, HIGH);
  digitalWrite(linker_motor, HIGH);
  digitalWrite(rechter_motor, HIGH);
}

void motor_stop(){
  digitalWrite(linker_motor_kloktegen, LOW);
  digitalWrite(rechter_motor_kloktegen, LOW);
  digitalWrite(linker_motor, LOW);
  digitalWrite(rechter_motor, LOW);
}

